                  "description_long": "<p>What do you get when you cross a classic slot game with a <strong>video slot</strong>? It&rsquo;s <strong>Jokerizer</strong> of course. This unique and highly-rated hybrid provides fast-paced gaming and a &lsquo;Mystery Mode&rsquo; in which you could win up to 6000 coins in a single spin!</p>\n\n<p>Transporting you right to the middle of an elaborate carnival is <strong>Jokerizer</strong>, the <strong>video</strong> <strong>slot machine </strong>you&rsquo;ll never forget. The Joker character, created by gaming developer Yggdrasil, is one of the most excitable, colourful and crazy characters you&rsquo;ll meet in a <strong>video</strong> <strong>slot machine</strong>&hellip; and he&rsquo;s the perfect thing to get your heart racing as you spin the reels for cash prizes.</p>\n\n<p>The symbols and general theme of <strong>Jokerizer</strong> is that of a relatively <strong>classic</strong> <strong>slot machine, </strong>with symbols of fruits, bells and more filling the reels. However, with bright, flashy colours and super smooth technology, it&rsquo;s clear that <strong>Jokerizer</strong> has been made using modern day development. Additionally, the game has implemented a bonus feature unique to Yggdrasil called <strong>Jokerizer</strong> mode, where you&rsquo;ll have the chance to pick up some easy money as you spin.</p>\n\n<p>Jokerizer mode: Whenever you have a win in the main game of <strong>Jokerizer</strong>, you&rsquo;ll be presented with a choice: to play Jokerizer mode, or to not play Jokerizer mode? If you choose not to, you&rsquo;ll be taken back to the main game to continue playing as per normal&hellip; but if you choose to play Jokerizer mode, this is where the real excitement begins. Firstly, you&rsquo;ll see a noticeable change in the game, with colours and animations flying everywhere&hellip; and then as you spin, each bet will cost you 20 coins &ndash; but the prizes you could win are much, much higher than in the main game, making it definitely worth playing for.</p>\n\n<p>Scatter symbols: Finding three or more of the joker symbols will award you an instant prize of up to 6000 coins!</p>\n",
