                  "description_long": "<p>Meet the wealthiest family of foxes in town with <strong>Foxin&rsquo; Wins</strong>, our five reel, 25 payline <strong>video</strong> <strong>slot machine</strong> that&rsquo;s packed with health, wealth and happiness. Enter this lavish underground house to discover bonus features of free spins and more to help you win!</p>\n\n<p>In this colourful game, you&rsquo;ll meet the wise father fox, the head of the family, who&rsquo;ll introduce you to his beautiful and charming wife. After building a fun-filled life together, they&rsquo;ve now settled into their cosy underground home to bring up their many fox children, who you&rsquo;ll see scattered around various hiding spots of the home. You&rsquo;ll also see many different symbols of wealth &ndash;these foxes are apparently not the humblest of animals, and do like to show off their wealth when possible. However, what they lack in subtlety, they make up for in generosity: for their guests only, their house is absolutely packed to the brim with bonus features to help you share in their wealth.</p>\n\n<p>Wilds: The fox children that are hiding around the house act as wild symbols in this <strong>video</strong> <strong>slot machine</strong> &ndash; and if you find them, they&rsquo;ll act as replacements for other symbols you might need in order to complete your winning combinations. And, the higher your bet, the more wild fox children you&rsquo;ll find!</p>\n\n<p>Free spins bonus round: Acting as a scatter symbol in this game is the gold pot symbol, which when you find at least three of will activate the free spins feature. Here, you&rsquo;ll be rewarded with 10 free spins &ndash; each with a multiplier of two times on any prize won from the free spins &ndash; as well as the opportunity to reveal even more wild fox children and more chances of completing your winning combinations.</p>\n\n<p>Leprechaun showdown: Leprechauns also live with these foxes&hellip; and if you manage to catch one, he&rsquo;ll give you a mystery cash prize!</p>\n",
