                  "description_long": "<p><strong>Dead or Alive </strong>is a 5 reels, 3 rows <strong>video</strong> <strong>slot machine</strong> with 9 bet lines. Saddle up and get ready for the Wild West! Win big by capturing wanted bandits and enjoy smoking hot features like sticky wilds, the chance of a re-trigger, free spins and scatter symbols.</p>\n\n<p>In a time when gunslingers, cowboys, desperados, Indians and sheriffs existed in the western part of North America and where the law of the gun ruled, you are now about to begin your adventure. The theme <strong>Dead or Alive</strong> is based on famous criminals at the time that could be found on wanted dead or alive posters in the wild west at the time. Who does not remember Billy the Kid, Jesse James, Wyatt Earp, Wild Bill Hickok and Buffalo Bill? The Wild West did not only have infamous male bad boys, you also had female bandits such as Calamity Jane and Belle Star.</p>\n\n<p>What would the good-old Wild West be without most wanted posters, sheriff stars, whiskey glasses, cowboy hats, boots and guns? These are just some of the symbols you&rsquo;ll find in this amazing <strong>video slot machine</strong>. It has state of the art graphics and you play against a backdrop of what looks and feels like a saloon, which is where your adventure begins. Wilds substitute any other symbols, with exception for the scatter symbols. When three or more scatter symbols appear you win twelve free spins. One awesome feature is that any win during the free spins rounds are doubled. When wild symbols appear they will turn into sticky wilds and remain on the reels for the rest of the free spins round. If you get five sticky wilds in a row, you win five additional free spins.</p>\n\n<p>Do you have what it takes as the new sheriff in town to capture these wanted bandits and collect your reward money?</p>\n",
